import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

const UserPage = () => {
    return(
        <Container>
            <Row className="userpage-container">
                <Col className='infor-container'>
                    <p className="userpage-info-title">Thông tin khách hàng</p>
                    <p className="userpage-info">Họ tên: Lê Thanh Toàn</p>
                    <p className="userpage-info">Địa chỉ: Ninh Kiều, Cần Thơ</p>
                    <p className="userpage-info">Email: toan@gmail.com</p>
                    <p className="userpage-info">SĐT: 077123123123</p>
                </Col>
                <Col className='infor-container'>
                    <p className="userpage-info-title">Vé đã mua</p>
                </Col>
            </Row>
        </Container>
    )
}
export default UserPage;
